import React from "react";
import BrandNavbar from "../../../components/BrandNavbar";

const Applicants = () => {
  return (
    <>
      <BrandNavbar />
      <div className="p-10 text-center">
        <h1 className="text-3xl font-bold text-pink-600">Campaign Applicants</h1>
        <p className="mt-4 text-gray-600">
          View and manage influencer applications for your campaigns.
        </p>
      </div>
    </>
  );
};

export default Applicants;
